import React from "react";
import { ReactComponent as IconNike } from "../assets/icons/iconNike.svg";
import { ReactComponent as GiftIcon } from "../assets/icons/gift.svg";
import { ImgCard1 } from "../assets/imgCard1.png";
import { ImgCard2 } from "../assets/imgCard2.png";
export const CardsData = [
  {
    iconHeader: <IconNike />,
    headerTitle: "Nike",
    status: "Активное",
    image: { ImgCard1 },
    title: "Записать сторис в кросcовках Nike Air Max 720",
    giftIcon: <GiftIcon />,
    gift: "Репост строис в официальном аккаунте NikeRussia",
  },
  {
    iconHeader: <IconNike />,
    headerTitle: "Nike",
    status: "Активное",
    image: {ImgCard2},
    title: "Записать сторис в кросcовках Nike Air Max 720",
    giftIcon: <GiftIcon />,
    gift: "Репост строис в официальном аккаунте NikeRussia",
  },
];
